function createCORSRequest(n,t){var i=new XMLHttpRequest;return"withCredentials"in i?i.open(n,t,!0):typeof XDomainRequest!="undefined"?(i=new XDomainRequest,i.open(n,t)):i=null,i}function getTitle(n){return n.match("<title>(.*)?<\/title>")[1]}function makeCorsRequest(n){var t=createCORSRequest("GET",n);if(!t){alert("CORS not supported");return}t.onload=function(){var i=t.responseText,r=getTitle(i);alert("Response from CORS request to "+n+": "+r)};t.onerror=function(){alert("Woops, there was an error making the request.")};t.send()}